import "./NextVideo.scss";
import VideoCard from "./video-card/VideoCard";

export default function NextVideos(props) {
  console.log(props.video);
  return (
    <article>
      {props.videos.map((video) => {
        return <VideoCard key={video.title} video={video} />;
      })}
    </article>
  );
}
